import { useEffect, useState } from 'react'; 
import logo from "../assets/logo.png";
import "../style/logoSection.scss"; 
const LogoSection = () => {
    const [date, setDate] = useState(null); 

    useEffect(() => {
        const nDate = new Date(); 
        const hour = nDate.getHours(); 
        alert(hour); 
    }, []); 

    return(
        <div className="logoSection">
            <div className="logoName">
                <img src={logo}/>
                <p><span>AceCoin</span>Pay</p>
            </div>
            
            <div className='timeContainer'>
                <div className="timeSquare"><p>0</p></div>
                <div className="timeSquare">1</div>
                <div className="timeColumn">:</div>
                <div className="timeSquare">1</div>
                <div className="timeSquare">9</div>
            </div>
        </div>
    )
}

export default LogoSection;
